import { useNavigate } from "react-router-dom"

export default function Home()
{
    const navigate=useNavigate();

    function handleCabAgencySignup()
    {
        navigate(`/signup/${"cabagency"}`)
    }

    function handleCustomerSignup()
    {
        navigate(`/signup/${"customer"}`)
    }

    return(
        <div>
            <h1>welcome to Cab Booking applicatioon</h1>
            <button onClick={handleCabAgencySignup}>Signup</button>
            <button onClick={handleCustomerSignup}>Signup</button>
        </div>
    )
}
